import React from 'react'
import { useLocation, useNavigate } from 'react-router-dom';
import '../App.css';
import AuthService from '../services/authservice';

function Dashboard() {
  const { state } = useLocation();
  
  const { marks, message, result } = state.response;

  const navigate = useNavigate();

  function loadData(){
    AuthService.verify(localStorage.getItem("TOKEN")).then(
      (res)=>{
        console.log(res);
      },
      (err)=>{
        console.log(err);
      }
    )
  }
  
  function handleLogout(){
    AuthService.logout();
    if(!localStorage.getItem("TOKEN")){
      navigate("/login");
    }
  }

  return (
    <div onLoad={loadData}>
      <button onClick={handleLogout} style={{float:"right"}}>LogOut</button>
      <h2>This is dashboard</h2>
      <table>
        <thead>
          <tr>
            <th>Sub1</th>
            <th>Sub2</th>
            <th>Sub3</th>
            <th>Sub4</th>
            <th>Sub5</th>
            <th>Sub6</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>{marks.sub1}</td>
            <td>{marks.sub2}</td>
            <td>{marks.sub3}</td>
            <td>{marks.sub4}</td>
            <td>{marks.sub5}</td>
            <td>{marks.sub6}</td>
          </tr>
        </tbody>
      </table>
      {console.log(message)}
      {console.log(result)}
    </div>

  )
}

export default Dashboard
